export default function Mems() {
  return (
    <div>
        <from className="form">
        <label>
        
        <input type="text" placeholder="top text" className="form--input" />
      </label>

      <label>
       
        <input type="text" placeholder="bottom text" className="form--input"  />
      </label>

      <button  className="form--button" > GET A NEW  IMAGE </button>


        </from>
     

    </div>
  );
}
